'''
You are given a 0-indexed integer array nums and an integer k.

You are initially standing at index 0. In one move, you can jump at most k steps forward without going outside the boundaries of the array. That is, you can jump from index i to any index in the range [i + 1, min(n - 1, i + k)] inclusive.

You want to reach the last index of the array (index n - 1). Your score is the sum of all nums[j] for each index j you visited in the array.

Return the "maximum score" you can get.

'''
import heapq
from typing import List

class Solution:
    def __init__(self):
        self.memo = {}

    def __maxScoreOnTempBridge(self, tempBridge: List[int], k: int, start: int, indent=''):
        if len(tempBridge[start:]) == 1:
            return tempBridge[start]

        if start in self.memo:
            return self.memo[start]

        tmpHeap = []
        maxScore = 0

        for j in range(start + 1, min(len(tempBridge), start + k + 1)):
            maxScore = self.__maxScoreOnTempBridge(tempBridge, k, j, indent=indent+'  ')
            tmpHeap.append(maxScore * -1)

        heapq.heapify(tmpHeap)

        maxScore  = heapq.heappop(tmpHeap) * -1
        maxScore += tempBridge[start]

        self.memo[start] = maxScore

        return maxScore

    def maxResult(self, nums: List[int], k: int) -> int:
        if len(nums) == 0:
            return 0

        steppingStones = []
        distance = 0
        tempBridge = [nums[0]]
        for i in range(1, len(nums)):
            #print("nums[{}] = {}".format(i, nums[i]))
            if nums[i] > 0:
                tempBridge.append(0) # A dummy terminator that should not impact the maxScore
                self.memo = {}
                maxScore  = self.__maxScoreOnTempBridge(tempBridge, k, 0)
                #print("maxScore for tempBridge {} is {}".format(tempBridge, maxScore))
                steppingStones.append(maxScore)
                tempBridge = [nums[i]]
            else:
                tempBridge.append(nums[i])

        # Here we did not add dummy terminator since we want to include the last element (requirement)
        maxScore = self.__maxScoreOnTempBridge(tempBridge, k, 0)
        steppingStones.append(maxScore)

        #print('steppingStones = {}'.format(steppingStones))
        return sum(steppingStones)

